    private function qrcode_ether()
    {

        $addr_recharge = Db::name('member')
            ->where('id', $this->user_id)
            ->value('addr_recharge');
        $fileName = "public\\uploads\\address\\" . $this->user_id . '.jpg';
        $filePath = "/uploads/address/" . $this->user_id . '.jpg';
        $outfile = root_path() . $fileName;
        $outfile = str_replace("/", "\\", $outfile);

        $result = [
            'data' => $addr_recharge,
            'outfile' => $outfile,
            'filePath' => $filePath
        ];
        return $result;
    }

